import React from 'react';
import './css/Study.css'; // Import CSS for styling
import { Link } from 'react-router-dom';

  // Logout functionality
  const handleLogout = (event) => {
    event.preventDefault();
    localStorage.removeItem("loggedIn");
    navigate("/login"); // Redirect to login pages after logout
  };
const ClassPage = () => {
  return (
    <div className="class-page">
      <header>
        <div className="container">
          <Link to="/" className="logo">LearnLinguaAI</Link>
          <nav>
            <ul>
              <li><Link to="/" className="active">Home</Link></li>
              <li><Link to="/study">Learn</Link></li>
              <li><Link to="/about">About</Link></li>
              <li className="dropdown">
                <a href="#" className="dropbtn">See More</a>
                <div className="dropdown-content">
                  <Link to="/user-profile">Profile</Link>
                  <Link to="/contact">Contact</Link>
                  <Link to="/setting">Setting</Link>
                  <Link to="/teacher">Teacher</Link>
                  <Link to="/chatbot">Chat</Link>
                  <a href="#" onClick={handleLogout}>Logout</a>
                </div>
              </li>
            </ul>
          </nav>
        </div>
      </header>

      <main className="main-content">
        <div className="empty-state">
          <img src="path/to/image.png" alt="Empty state" className="empty-image" /> {/* Replace with actual image path */}
          <h2>You havenâ€™t joined any classes yet.</h2>
          <p>Quizizz is more fun with friends.</p>
          <button className="join-class-button">Join a Class</button>
        </div>
      </main>
    </div>
  );
};

export default ClassPage;
